    super(props);
    this.state={
        data:[]
    }
    }
    componentDidMount() {
        fetch(
            'https://api.nasa.gov/mars-photos/api/v1/rovers/curiosity/photos?earth_date=2015-6-3&api_key=7gTfQoM9v41twf39OxS7sgAZf8ILQ8np5c9eKa66')
            .then((res)=>res.json())
            .then((data)=>
            {
             this.setState({
               data
             })
          });

        }
    render(){
        console.log(this.state.data)
        const card=this.state.data.photos.map(ele=>{
           return (
           <div>
              <div>{ele.full_name}</div>
                <div></div>
                <div></div>
                <div></div>
            </div>
        )})

        return(
<div className="cardHolder">
{card}
</div>
        )
    }
}
export default (Card);
